INSERT INTO `careers` (`id`, `title`, `slug`, `start_date`, `end_date`, `image`, `content`, `seo_title`, `meta_key`, `meta_description`, `created_by`, `modified_by`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Sr. Software Developer', 'sr-software-developer', '2020-10-01', '2020-10-30', NULL, '<div class=\"vac\" style=\"box-sizing: border-box; color: rgb(155, 171, 179); font-family: \">\r\n<h5><span style=\"color:rgb(0, 0, 0)\">Vacancy</span></h5>\r\n\r\n<p><span style=\"color:rgb(0, 0, 0)\">04</span></p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"job_des\" style=\"box-sizing: border-box; color: rgb(155, 171, 179); font-family: \">\r\n<h5><span style=\"color:rgb(0, 0, 0)\">Job Context</span></h5>\r\n\r\n<ul>\r\n	<li>Experience in Laravel or Codeigniter framework is strongly preferred. This position requires a developer with the skills and experience in building modern web applications using the latest back-end and front-end technologies. You must write clean, reusable code with strong emphasis on stability and performance.</li>\r\n</ul>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"job_des\" style=\"box-sizing: border-box; color: rgb(155, 171, 179); font-family: \">\r\n<h5>&nbsp;</h5>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<h5><span style=\"color:rgb(0, 0, 0)\">Job Responsibilities</span></h5>\r\n\r\n<ul>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Must have experience in web based application development using Laravel and Codeigniter</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Candidate with working (Software Development/Management) experience in ERP/CRM will be given preference</span><br />\r\n	<span style=\"color:rgb(0, 0, 0)\">Should be capable to complete a project in PHP by yourself as a core developer.</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Excellent knowledge in Object Oriented PHP. Version control experience required.</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Must have hands on experience in Object Oriented PHP, JavaScript, AJAX, JQuery client side script.</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Good understanding of front-end technologies, including HTML5, CSS3, Bootstrap</span><br />\r\n	<span style=\"color:rgb(0, 0, 0)\">Strong knowledge of relational databases, i.e. MySQL, PostgreSQL</span><br />\r\n	<span style=\"color:rgb(0, 0, 0)\">API integration such as Facebook, Google, Twitter, PayPal, Authorize, braintreepayments, etc.</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Participate in the development, maintenance and quality control of programming code.</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Knowledge on SDLC (Software Development Life Cycle) for custom and standard online software, strong understanding of PHP front &amp; back-end development with different standard frameworks, along with front end integration.</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Ability to test, debug and fix software bugs.</span></li>\r\n</ul>\r\n</div>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"job_nat\" style=\"box-sizing: border-box; color: rgb(155, 171, 179); font-family: \">\r\n<h5><span style=\"color:rgb(0, 0, 0)\">Employment Status</span></h5>\r\n\r\n<p><span style=\"color:rgb(0, 0, 0)\">Full-time</span></p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style=\"color:rgb(0, 0, 0)\">Educational Requirements</span></strong></p>\r\n\r\n<div class=\"edu_req\" style=\"box-sizing: border-box; color: rgb(155, 171, 179); font-family: \">\r\n<ul>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Bachelor of Science (BSc) in&nbsp;<strong>CSE</strong></span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">B.Sc in&nbsp;<strong>Computer Science/ Engineering</strong>&nbsp;from a reputed university</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Bachelor degree</span></li>\r\n</ul>\r\n</div>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"edu_req\" style=\"box-sizing: border-box; color: rgb(155, 171, 179); font-family: \">\r\n<h5><span style=\"color:rgb(0, 0, 0)\">Experience Requirements</span></h5>\r\n\r\n<ul>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">2 to 3 year(s)</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">The applicants should have experience in the following area(s):&nbsp; Programmer/ Software Engineer (<strong>ERP, POS, Accounting</strong>) , Database Engineer/ Database Programmer, Software Implementation, MIS</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">The applicants should have experience in the following business area(s):</span><br />\r\n	<span style=\"color:rgb(0, 0, 0)\">Software Company</span></li>\r\n</ul>\r\n</div>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"job_req\" style=\"box-sizing: border-box; color: rgb(155, 171, 179); font-family: \">\r\n<h5><span style=\"color:rgb(0, 0, 0)\">Additional Requirements</span></h5>\r\n\r\n<ul>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Age 26 to 32 years</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Only males are allowed to apply</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Ability to work individually or as part of a collaborative team</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Completing all tasks on time</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">If you don&rsquo;t have 2 years of experience with Laravel, Codeigniter, jQuery and Ajax, please do not apply.</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Candidate with working (Software Development/Management) experience in ERP/CRM will be given preference</span><br />\r\n	<span style=\"color:rgb(0, 0, 0)\">Must be very strong in business communication</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Must have 2+ year hands on experience in JavaScript, AJAX, jQuery client side script development as well as HTML5, CSS &amp; Bootstrap.</span></li>\r\n	<li><span style=\"color:rgb(0, 0, 0)\">Must have hands on experience in Object Oriented PHP, Laravel, Codeigniter, JavaScript, jQuery, AJAX, XML/JSON and Database Design.</span></li>\r\n</ul>\r\n</div>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"job_loc \" style=\"box-sizing: border-box; color: rgb(155, 171, 179); font-family: \">\r\n<h5><span style=\"color:rgb(0, 0, 0)\">Job Location</span></h5>\r\n\r\n<p><span style=\"color:rgb(0, 0, 0)\">House 34 (3B), Road 2, Nikunja 2, Dhaka 1229</span></p>\r\n</div>\r\n\r\n<h5>&nbsp;</h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"salary_range\" style=\"box-sizing: border-box; color: rgb(155, 171, 179); font-family: \">\r\n<h5><span style=\"color:rgb(0, 0, 0)\">Salary</span></h5>\r\n\r\n<p><span style=\"color:rgb(0, 0, 0)\">Negotiable</span></p>\r\n</div>\r\n\r\n<div style=\"box-sizing: border-box; color: rgb(155, 171, 179); font-family: \">&nbsp;</div>\r\n\r\n<p><span style=\"color:rgb(0, 0, 0)\">Send your CV at&nbsp;<strong>career@nextpagetl.com</strong>&nbsp;by 30th September, 2018.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><strong><span style=\"color:rgb(0, 0, 0)\">Next Page Technology Ltd.</span></strong></h4>\r\n\r\n<p><span style=\"color:rgb(0, 0, 0)\">Contect: +8801711084621</span><br />\r\n<span style=\"color:rgb(0, 0, 0)\">Address: House 34 (3B), Road 2, Nikunja 2, Dhaka 1229</span></p>', NULL, NULL, NULL, 1, 1, 1, '2018-12-14 01:23:15', '2020-10-04 16:12:06'),
(2, 'Web Designer (UI & UX)', 'web-designer-ui-ux', '2019-09-27', '2019-09-30', NULL, '<p dir=\"ltr\"><span style=\"color:rgb(29, 33, 41); font-family:arial; font-size:10.5pt\">Send your CV : </span><a href=\"mailto:career@nextpagetl.com\" style=\"text-decoration-line: none;\"><strong>career@nextpagetl.com</strong></a><strong>&nbsp;</strong></p>\r\n\r\n<h5 dir=\"ltr\"><strong>Vacancy</strong></h5>\r\n\r\n<p dir=\"ltr\"><span style=\"background-color:transparent; color:rgb(92, 92, 92); font-family:arial; font-size:10.5pt\">02</span></p>\r\n\r\n<p dir=\"ltr\"><strong>Job Context</strong></p>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"color:rgb(51, 51, 51); font-size:10.5pt\">We are looking for an experienced and creative Front-end Designer and Developer to join our team! As an Front-end Developer, you will be responsible for delivering the best online user experience, which makes your role extremely important for our success and ensuring customer satisfaction and loyalty.</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><strong>Job Responsibilities</strong></p>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Responsible to design and build Frontend of Our Existing and New Application</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Create and implement creative UI Idea to improve customer experience</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Ensure the performance, quality, and responsiveness of applications</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Building reusable components and front-end libraries for future use</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Optimizing components for maximum performance across a vast array of web-capable devices and browsers</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Collaborate with a team to define, design, and ship new features</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Identify and correct bottlenecks and fix bugs</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Work with outside data sources and APIs</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Help maintain code quality, organization, and authorization</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Continuously discover, evaluate, and implement new technologies to maximize development efficiency.</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><strong>Employment Status</strong></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">Full-time</span></p>\r\n\r\n<p dir=\"ltr\"><strong>Educational Requirements</strong></p>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Bachelor of Science (BSc) in CSE</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Skills Required: Adobe Photoshop/ Illustrator, Bootstrap, HTML5 &amp; CSS3, JavaScript, jQuery, Web Design,</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><strong>Experience Requirements</strong></p>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">1 to 3 year(s)</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">The applicants should have experience in the following area(s):</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">Graphic Designer, UI design, UX Designer, Web Developer/ Web Designer&nbsp;</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">* The applicants should have&nbsp;</span></p>\r\n\r\n<p dir=\"ltr\"><strong>Experience in the following business area(s):</strong></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">Software Company, Web Media/Blog</span></p>\r\n\r\n<p dir=\"ltr\"><strong>Additional Requirements</strong></p>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Age 24 to 36 years</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Both males and females are allowed to apply</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">1+ years of experience desired. however, your technical and design abilities are the most important factor</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Able to work with team and Sincere appreciation for good communication and healthy work relationships.</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Self Driven and learning attitude</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Strong proficiency in JavaScript, including DOM manipulation and the JavaScript object mode</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Proficiency developing front end using HTML5, Bootstrap, CSS3, and JS.</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Responsive site work and/or mobile development - material design or bootstrap.</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Advance Knowledge on Modern Javascript (ES6+), ideally React/JSX, Flux, Redux.</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Experience with front-end build tools (NPM, Webpack, Grunt/Gulp).</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Knowledge on JSP, JSF, Primefaces with latest version</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Experience with AJAX</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Test Driven Development</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Experience with RESTful Web Services</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Experience building and maintaining large, complex software products at scale (either consumer or enterprise).</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Ability to explain technical concepts to a group clearly and concisely.</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Ability to understand business requirements and translate them into technical requirements</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Experience with Agile software development is preferred</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Get Advantage to working experience with ReactJS</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Experience with common development and repository tools (i.e. SVN, GIT, JIRA, etc.)</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><strong>Job Location</strong></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">Dhaka</span></p>\r\n\r\n<p dir=\"ltr\"><strong>Salary</strong></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">Negotiable</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">Compensation &amp; Other Benefits</span></p>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Salary Review: Yearly</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">Festival Bonus: 2</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"font-size:10.5pt\">As per HR Policy</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">Apply Procedure</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">Send your CV to </span><strong>career@nextpagetl.com</strong></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">Application Deadline : August 31, 2019</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">Company Information </span><strong>NEXT PAGE TECHNOLOGY LTD</strong><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">.&nbsp;</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">Address : House 34(3B), Road 2, Nikunja 2, Dhaka-1229</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:10.5pt\">&nbsp;Web : </span><span style=\"color:rgb(17, 85, 204); font-family:arial; font-size:10.5pt\"><a href=\"https://nextpagetl.com/\" style=\"text-decoration-line: none;\">https://nextpagetl.com/</a></span></p>\r\n\r\n<div>&nbsp;</div>', NULL, NULL, NULL, 1, 1, 1, '2019-08-24 20:42:36', '2019-09-26 09:48:36'),
(3, 'Mobile App Developer', 'mobile-app-developer', '2019-10-03', '2019-10-28', NULL, '<h4><strong>Vacancy</strong></h4>\r\n\r\n<p><span style=\"background-color:transparent; color:rgb(92, 92, 92); font-family:arial; font-size:10.5pt\">2</span></p>\r\n\r\n<h4><strong>Job Context</strong></h4>\r\n\r\n<p><span style=\"background-color:transparent; font-family:arial; font-size:10.5pt\">We are looking for a React Native/flutter developer interested in building performant mobile apps on both the iOS and Android platforms. You will be responsible for architecting and building these applications, as well as coordinating with the teams responsible for other layers of the product infrastructure. Building a product is a highly collaborative effort, and as such, a strong team player with a commitment to perfection is required.</span></p>\r\n\r\n<h4 dir=\"ltr\"><strong>Job Responsibilities</strong></h4>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">Build pixel-perfect, buttery smooth UIs across both mobile platforms.</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">Leverage native APIs for deep integrations with both platforms.</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">Diagnose and fix bugs and performance bottlenecks for performance that feels native.</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">Maintain code and write automated tests to ensure the product is of the highest quality.</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<h4 dir=\"ltr\"><strong>Employment Status</strong></h4>\r\n\r\n<p dir=\"ltr\"><span style=\"background-color:transparent; color:rgb(92, 92, 92); font-family:arial; font-size:10.5pt\">Full-time</span></p>\r\n\r\n<h4 dir=\"ltr\"><strong>Educational Requirements</strong></h4>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">Bachelor degree in any discipline</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<h4 dir=\"ltr\"><strong>Experience Requirements</strong></h4>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">At least 2 year(s)</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">The applicants should have experience in the following area(s):</span><br />\r\n	<span style=\"background-color:transparent; font-size:10.5pt\">Android application development, iOS Application Development, JavaScript, React JS,React Native,Flutter , REST API</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<h4 dir=\"ltr\"><strong>Additional Requirements</strong></h4>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">Age at least 25 years</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">Both males and females are allowed to apply</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">Knowledge of functional or object-oriented programming</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">Ability to write well-documented, clean Javascript code</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">Familiarity with native build tools, like XCode, Gradle, Android Studio, IntelliJ</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">Understanding of REST APIs, the document request model, and offline storage</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">Experiences with automated testing suites, like Jest or Mocha</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; font-size:10.5pt\">At least one app released on the App Store or Google Play Store.</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<h4 dir=\"ltr\"><strong>Job Location</strong></h4>\r\n\r\n<p dir=\"ltr\"><span style=\"background-color:transparent; color:rgb(92, 92, 92); font-family:arial; font-size:10.5pt\">Dhaka (Nikunja 2)</span></p>\r\n\r\n<h4 dir=\"ltr\"><strong>Salary</strong></h4>\r\n\r\n<p dir=\"ltr\"><span style=\"background-color:transparent; font-family:arial; font-size:10.5pt\">Negotiable</span></p>\r\n\r\n<h4 dir=\"ltr\"><strong>Compensation &amp; Other Benefits</strong></h4>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; color:rgb(29, 33, 41); font-size:10.5pt\">Salary Review: Yearly</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; color:rgb(29, 33, 41); font-size:10.5pt\">Festival Bonus: 2</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; color:rgb(29, 33, 41); font-size:10.5pt\">As per HR Policy</span></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><span style=\"background-color:transparent; color:rgb(29, 33, 41); font-size:10.5pt\">Apply Procedure</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><span style=\"background-color:transparent; color:rgb(29, 33, 41); font-family:arial; font-size:10.5pt\">Send your CV to career@nextpagetl.com</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"background-color:transparent; color:rgb(29, 33, 41); font-family:arial; font-size:10.5pt\">Application Deadline: 22 september, 2019</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"background-color:transparent; color:rgb(29, 33, 41); font-family:arial; font-size:10.5pt\">Company Information NEXT PAGE TECHNOLOGY LTD.</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"background-color:transparent; color:rgb(29, 33, 41); font-family:arial; font-size:10.5pt\">Address : House 34(3B), Road 2, Nikunja 2, Dhaka-1229</span></p>\r\n\r\n<div>&nbsp;</div>', 'Mobile App Developer', 'Mobile,App,Developer', 'We are looking for a React Native/flutter developer interested in building performant mobile apps on both the iOS and Android platforms. You will be responsible for architecting and building these applications, as well as coordinating with the teams responsible for other layers of the product infrastructure. Building a product is a highly collaborative effort, and as such, a strong team player with a commitment to perfection is required.', 1, 1, 1, '2019-09-14 19:46:29', '2020-10-04 15:55:02'),
(4, 'new jobs', 'new-jobs', '2019-09-25', '2019-09-30', 'banner.jpg', '<p>asdasdasd</p>', NULL, NULL, NULL, 1, 1, 1, '2019-09-26 09:20:34', '2019-09-28 03:38:09'),
(5, 'Chief Financial Officer (CFO)', 'chief-financial-officer-cfo', '2019-10-01', '2019-10-30', 'g_796_a797_night_render.jpg', '<div class=\"col-sm-9 col-sm-pull-9\">\r\n<h4>Chief Financial Officer (CFO)</h4>\r\n\r\n<h2>Zantrik</h2>\r\n</div>\r\n\r\n<div class=\"view-all-jobs\">View all jobs of this company</div>\r\n\r\n<div class=\"vac\">\r\n<h5>Vacancy</h5>\r\n\r\n<p>1</p>\r\n</div>\r\n\r\n<div class=\"job_des\">\r\n<h5>Job Context</h5>\r\n\r\n<ul>\r\n	<li>Zantrik (http://zantrik.com), is unified automobile maintenance platform, offering the most reliable vehicle maintenance service in Bangladesh, is looking for a &quot;Chief Financial Officer (CFO)&quot; for our dynamic and growing Finance &amp; Accounts team. Details are provided below</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"job_des\">\r\n<h5>Job Responsibilities</h5>\r\n\r\n<ul>\r\n	<li>Cost analysis and maximizing product margin.</li>\r\n	<li>Business forecast and preparing financial model for business, Budgeting and implantation.</li>\r\n	<li>Manages day-to-day accounting, invoicing, payroll, cash management and internal financial reporting</li>\r\n	<li>Ensure accurate and timely reporting to Management &amp; Investors.</li>\r\n	<li>Continually reviews work practices and procedures for better operational efficiency and potential issues in accounts, financial processes and controls and proactively raise management attention to act and resolve</li>\r\n	<li>Developing compliance process and managing team with leadership knowledge.</li>\r\n	<li>Fraud analysis and strictly monitoring any type of revenue leakages.</li>\r\n	<li>Providing accounts for auditing and facing outer audit with confident.</li>\r\n	<li>Presenting business and financial model to board of directors and investors.</li>\r\n	<li>Collection of sales revenue in various channels as online payment, bkash (merchant &amp; personal), cash and cheque.</li>\r\n	<li>Preparing invoice/bills for customer and follow up, tracking, settlement and collection payment with corporate and loyal partners.</li>\r\n	<li>Managing vouchers, preparing salary sheets and disbursement accordingly.</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"job_nat\">\r\n<h5>Employment Status</h5>\r\n\r\n<p>Full-time</p>\r\n</div>\r\n\r\n<div class=\"edu_req\">\r\n<h5>Educational Requirements</h5>\r\n\r\n<ul>\r\n	<li>Master of Commerce (MCom)</li>\r\n	<li>ACCA/CPA would be more preferred.</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"edu_req\">\r\n<h5>Experience Requirements</h5>\r\n\r\n<ul>\r\n	<li>10 to 15 year(s)</li>\r\n	<li>The applicants should have experience in the following area(s):<br />\r\n	Analytical skills, CA, Internal Audit, Accounting, Accounting Software, Budgets, Costing, Credit Control And Recovery, Finance</li>\r\n	<li>The applicants should have experience in the following business area(s):<br />\r\n	Automobile</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"job_req\">\r\n<h5>Additional Requirements</h5>\r\n\r\n<ul>\r\n	<li>Age 30 to 40 years</li>\r\n	<li>Good Communication skill on Bengali.</li>\r\n	<li>Must have well manner and well behaved to team, customer, and suppliers.</li>\r\n	<li>Ability to pitching to VC and angels on financial business model.</li>\r\n	<li>Experience of working in accounting software will be preferable.</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"job_loc \" style=\"line-height: 24px;\">\r\n<h5>Job Location</h5>\r\n\r\n<p>Dhaka, Dhaka (Uttara)</p>\r\n</div>\r\n\r\n<div class=\"salary_range\">\r\n<h5>Salary</h5>\r\n\r\n<ul>\r\n	<li>Negotiable</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"oth_ben\">\r\n<h5>Compensation &amp; Other Benefits</h5>\r\n\r\n<ul>\r\n	<li>Mobile bill</li>\r\n	<li>Lunch Facilities: Full Subsidize</li>\r\n	<li>Salary Review: Yearly</li>\r\n	<li>Festival Bonus: 2</li>\r\n</ul>\r\n</div>', NULL, NULL, NULL, 1, 1, 1, '2019-10-01 14:24:30', '2020-10-04 15:54:40'),
(6, 'Sr. Executive/ Executive, Sales', 'sr-executive-executive-sales', '2021-06-01', '2021-06-25', NULL, '<p><span style=\"color:#0000CD\"><strong>Vacancy</strong></span></p>\r\n\r\n<p>Not specific 08</p>\r\n\r\n<p><span style=\"color:#008000\"><strong>Job Responsibilities</strong></span></p>\r\n\r\n<ul>\r\n	<li>Meet the Sale&nbsp; target</li>\r\n	<li>Expected to be target oriented and ensure the achievement on time.</li>\r\n	<li>The incumbent have to visit client.</li>\r\n	<li>Creating new customer to accrue the sales target.</li>\r\n	<li>Building a strong relationship with the customer.</li>\r\n	<li>Additional job Define by management</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:25.05pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:7.05pt\">&nbsp;</p>\r\n\r\n<p><span style=\"color:#0000CD\"><strong>Employment Status</strong></span></p>\r\n\r\n<p>Full-time</p>\r\n\r\n<p><strong>Educational Requirements</strong></p>\r\n\r\n<ul>\r\n	<li>Bachelor degree in any discipline</li>\r\n	<li>Bachelor/ MBA (preferably in Marketing) from any reputed University.</li>\r\n</ul>\r\n\r\n<p><span style=\"color:#FF0000\"><strong>Experience Requirements</strong></span></p>\r\n\r\n<ul>\r\n	<li>At least 0 to 3 year(s)</li>\r\n	<li>The applicants should have experience in the following area(s):<br />\r\n	Real Estate Marketing, Sales</li>\r\n	<li>The applicants should have experience in the following business area(s):<br />\r\n	Developer, Real Estate</li>\r\n</ul>\r\n\r\n<p><span style=\"color:#008000\"><strong>Additional Requirements</strong></span></p>\r\n\r\n<ul>\r\n	<li>Age at most 33 years</li>\r\n	<li>Males &nbsp;&amp; female are allowed to apply</li>\r\n	<li>Candidates having relevant work experience in Real Estate Company are strongly encouraged to apply.</li>\r\n	<li>Excellent communication &amp; negotiation skill.</li>\r\n	<li>Must be a team player, proactive, self-motivated, and willing to take initiative and result oriented.</li>\r\n	<li>Able to cope with constant changes under immense pressure.</li>\r\n</ul>\r\n\r\n<p><strong>Job Location</strong></p>\r\n\r\n<p>Dhaka</p>\r\n\r\n<p><span style=\"color:#0000CD\"><strong>Salary</strong></span></p>\r\n\r\n<p style=\"margin-left:25.05pt\">Negotiable</p>\r\n\r\n<p><span style=\"color:#0000CD\"><strong>Compensation &amp; Other Benefits</strong></span></p>\r\n\r\n<ul>\r\n	<li>Mobile bill, &nbsp;</li>\r\n	<li>Salary Review: Yearly</li>\r\n	<li>Festival Bonus: 2</li>\r\n	<li>As per company policy</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#FF0000\"><strong>email:hr@homeauthoritybd.com</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, 1, 1, 1, '2021-06-01 03:29:15', '2021-06-13 02:27:48');
