(1, 'PRIVACY POLICY', 'PRIVACY POLICY', NULL, NULL, NULL, NULL, '<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:18px\">We understand the importance of protecting customers&rsquo; private information.</span></li>\r\n	<li><span style=\"font-size:18px\">We will only use your name, address, phone number and email for the purpose of communicating with you.</span></li>\r\n	<li><span style=\"font-size:18px\">We do not sell your information to any third party.</span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'privacy-policy', NULL, 118, NULL, NULL, NULL, 1, 1, 1, '2019-04-24 13:10:27', '2019-11-16 04:45:50'),
(2, 'Company Background', 'Company Background', NULL, NULL, NULL, NULL, '<ul>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:18px\">You certify that the content you provide in this site is accurate and complete. You are solely responsible for maintaining the confidentiality and </span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:18px\">security of your account including username, password, and PIN.&nbsp;&nbsp;Mahmud Mart won&rsquo;t be responsible for any losses arising from unauthorized </span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:18px\">use of your account.&nbsp;&nbsp;You agree that Mahmud Mart does not have any responsibility if you lose or share access to your device</span></li>\r\n</ul>', 'company-background', NULL, 138, NULL, NULL, NULL, 1, 1, 1, '2019-07-09 03:30:24', '2022-02-27 22:23:12'),
(3, 'Why Land Bangla', 'Why Land Bangla Development Ltd.', NULL, NULL, NULL, NULL, '<h1>Why We are?</h1>', 'why-land-bangla-development-ltd', NULL, 142, NULL, NULL, NULL, 1, 1, 1, '2019-07-09 04:51:12', '2022-02-27 06:37:35');
