(2, 'Investor Presentation / Pitch Deck', 'Crafting compelling investor presentations and pitch decks that differentiate you from your peers. We leveraging data analytics, financial models and market research to make an effective presentation or pitch deck to grab a prospective investors attention.', '<p>Crafting compelling investor presentations and pitch decks that differentiate you from your peers. We leveraging data analytics, financial models and market research to make an effective presentation or pitch deck to grab a prospective investor&rsquo;s attention.</p>', NULL, 'investor-presentation-pitch-deck', '123213', 'in_stock', NULL, 342342.00, 12312.00, 5, NULL, NULL, NULL, NULL, 1, 4, NULL, 0, NULL, NULL, NULL, 1, NULL, 1, '2019-08-08 10:08:25', '2019-08-08 10:08:25');
