(23, 'sm_theme_options_home_setting', 'a:12:{s:25:\"project_top_section_title\";s:21:\"BUILD YOUR DREAM HOME\";s:27:\"project_top_section_caption\";s:28:\"COME TO THE WORLD SINCE 2012\";s:24:\"project_top_section_link\";s:6:\"/about\";s:25:\"project_top_section_image\";s:14:\"user-pro-1.jpg\";s:20:\"home_left_image_link\";s:1:\"#\";s:16:\"extra_facilities\";a:9:{i:0;a:4:{s:16:\"facilities_title\";s:27:\"Unique Architectural Design\";s:22:\"facilities_description\";s:179:\"Dcastalia, derived from the name Castalia Digital, inspires spontaneous flow of creative ideas and innovations. Since our inception dated back in 2008, we have delivered amazing .\";s:15:\"facilities_link\";s:31:\"http://formonic.nextpagetl.com/\";s:16:\"facilities_image\";s:36:\"280ed1b3f10798ccd446eb2c48fb7915.jpg\";}i:1;a:4:{s:16:\"facilities_title\";s:30:\"Modern & Echo Friendly Design \";s:22:\"facilities_description\";s:365:\"Environmental awareness has made huge leaps and bounds in recent years. More and more people are becoming conscious of how their actions and lives effect the environment. These green trends have made their way into construction and home design. Eco friendly home designs feature several different characteristics, from the building materials to the interior design.\";s:15:\"facilities_link\";s:31:\"http://formonic.nextpagetl.com/\";s:16:\"facilities_image\";s:8:\"eco.jpeg\";}i:2;a:4:{s:16:\"facilities_title\";s:24:\"Maximum Area Utilization\";s:22:\"facilities_description\";s:319:\"Every organization places great value on its working space. The area or environment dedicated to operating a facility comes with a significant cost, including the real estate value, the operating expenses and the effectiveness of people working in that space. Home Authority always working for Maximum Area Utilization.\";s:15:\"facilities_link\";s:0:\"\";s:16:\"facilities_image\";s:12:\"ahea_utl.jpg\";}i:3;a:4:{s:16:\"facilities_title\";s:23:\"High Quality Materials \";s:22:\"facilities_description\";s:407:\"The old saying you get out what you put in is particularly true when it comes to buildings and construction. Using high-quality building materials will result in a strong and durable structure that can withstand the test of time. Contractors that use cheap and low-quality supplies will produce structures that are of compromised integrity. Home Authority never Negotiate about High Quality Materials.\";s:15:\"facilities_link\";s:0:\"\";s:16:\"facilities_image\";s:8:\"hq_m.png\";}i:4;a:4:{s:16:\"facilities_title\";s:23:\"Skilled Technical Team \";s:22:\"facilities_description\";s:333:\"The Skilled Technical Team will be a multidisciplinary team that includes experts in all of the Core Values. Roles and Responsibilities: The roles and responsibilities of the Technical Team include: Assuring that local context is defined and integrated into the project. Home Authority never negotiate about \"Skilled Technical Team\".\";s:15:\"facilities_link\";s:0:\"\";s:16:\"facilities_image\";s:21:\"skilled_tech_team.jpg\";}i:5;a:4:{s:16:\"facilities_title\";s:17:\"On Time Delivery \";s:22:\"facilities_description\";s:251:\"On Time Delivery or OTD refers to a key performance indicator measuring the rate of finished product and deliveries made in time. This rate is expressed in a total number of units delivered within a set period defined by the customer and the supplier.\";s:15:\"facilities_link\";s:0:\"\";s:16:\"facilities_image\";s:20:\"on_time_delivery.png\";}i:6;a:4:{s:16:\"facilities_title\";s:17:\"Full consultation\";s:22:\"facilities_description\";s:227:\"Real estate decisions can be difficult and complicated, which is why its important to take an informed approach. With our popular Full Consultation service, you can count on us to guide you through every step of the process.\";s:15:\"facilities_link\";s:0:\"\";s:16:\"facilities_image\";s:55:\"business-woman-explaining-at-conference-stock-photo.jpg\";}i:7;a:4:{s:16:\"facilities_title\";s:18:\"Property appraisal\";s:22:\"facilities_description\";s:214:\"As one of our most popular offerings, appointments for our Property Appraisal service tends to fill up fast. Dont feel you have to do it alone. Well provide all the resources and guidance you need to succeed.\";s:15:\"facilities_link\";s:0:\"\";s:16:\"facilities_image\";s:14:\"1620761180.jpg\";}i:8;a:4:{s:16:\"facilities_title\";s:16:\"Property showing\";s:22:\"facilities_description\";s:263:\"Throughout many years of providing Property Showing services to clients, our team has gained the experience and expertise necessary to make it as efficient as possible. If you have any questions, just reach out and well be happy to give your further details.\n\n\";s:15:\"facilities_link\";s:0:\"\";s:16:\"facilities_image\";s:72:\"confident-real-estate-agent-showing-new-property-to-couple-masf20402.jpg\";}}s:22:\"total_complete_project\";s:2:\"72\";s:27:\"total_complete_project_icon\";s:5:\"1.png\";s:18:\"total_happy_client\";s:3:\"135\";s:23:\"total_happy_client_icon\";s:5:\"2.png\";s:15:\"qualified_staff\";s:2:\"25\";s:20:\"qualified_staff_icon\";s:5:\"3.png\";}', 1, 1, 1, 2, NULL, '2021-10-03 08:23:07'),
(24, 'sm_theme_options_contact_setting', 'a:9:{s:20:\"contact_banner_title\";s:10:\"CONTACT US\";s:23:\"contact_banner_subtitle\";s:54:\"We will make every attempt to respond within 24 hours.\";s:20:\"contact_banner_image\";s:13:\"banner-01.jpg\";s:13:\"contact_title\";s:14:\"We Always Help\";s:16:\"contact_subtitle\";s:78:\"It is Easy To Reach Us For Any Digital Marketing Support Anytime From Anywhere\";s:17:\"contact_des_title\";s:15:\"CONNECT WITH US\";s:19:\"contact_description\";N;s:18:\"contact_form_title\";s:18:\"Leave Us a Message\";s:28:\"contact_form_success_message\";s:64:\"Mail successfully send. We will contact you as soon as possible.\";}', 1, 1, 1, 2, NULL, '2020-11-01 20:59:01'),
(25, 'sm_theme_options_about_setting', 'a:10:{s:18:\"about_banner_title\";s:8:\"ABOUT US\";s:21:\"about_banner_subtitle\";s:24:\"A World of Opportunities\";s:18:\"about_banner_image\";s:47:\"cash-back-discount-real-estate-banner-one-1.jpg\";s:9:\"wwr_title\";s:8:\"About Us\";s:12:\"wwr_subtitle\";N;s:15:\"wwr_description\";s:749:\"<h2><span style=\"font-size:24px\">A Leading Real Estate company in Bangladesh</span></h2>\r\n\r\n<p>Quality comes first while setting priority for long-term or short-term plans and day-to-day activities. From material to workmanship, we strive to maintain quality in every stage in our building projects. With this great effort, we have achieved the trust of our clients that fuel our sincere efforts.</p>\r\n\r\n<p>We design and develop buildings in line with the compliance guidelines stated in the National Building Code. We never deviate from the standards and best practices in the industry for providing safe addresses to our esteemed clients. Therefore, our buildings are capable of withstanding the code-specified natural forces like earthquakes.</p>\";s:18:\"our_mission_banner\";s:18:\"vision-mission.png\";s:11:\"our_mission\";s:858:\"<ul>\r\n	<li><span style=\"font-family:times new roman,times,serif\"><span style=\"font-size:18px\"><strong>For Our Clients:</strong>&nbsp;To offer a global touch, maintaining Bangladeshi culture in living and work places, with utmost uncompromising service to our clients and value for money.</span></span><br />\r\n	&nbsp;</li>\r\n	<li><span style=\"font-family:times new roman,times,serif\"><span style=\"font-size:18px\"><strong>For Our Investors:</strong>&nbsp;To ensure a smooth upward-reasonable trend of return on investment.</span></span><br />\r\n	&nbsp;</li>\r\n	<li><span style=\"font-family:times new roman,times,serif\"><span style=\"font-size:18px\"><strong>For Our Employees:</strong>&nbsp;To give employees a feeling of satisfaction by maximizing their potentials and providing means for their personal well-being and career development.</span></span></li>\r\n</ul>\";s:17:\"our_vision_banner\";s:33:\"istockphoto-500504909-170667a.jpg\";s:10:\"our_vision\";s:264:\"<p><span style=\"font-size:20px\"><span style=\"font-family:times new roman,times,serif\">To set Land Bangla as an icon for both clients and competitors in the fields of innovation, product quality, service standard, profitability and community work.</span></span></p>\";}', 1, 1, 1, 2, NULL, '2021-10-03 10:27:47'),
(26, 'sm_theme_options_faq_setting', 'a:7:{s:9:\"faq_title\";s:3:\"FAQ\";s:12:\"faq_subtitle\";s:25:\"You can ask any question.\";s:16:\"faq_banner_image\";s:13:\"service-5.jpg\";s:12:\"faq_sections\";a:5:{i:0;a:2:{s:9:\"faq_title\";s:20:\" Our company mission\";s:15:\"faq_description\";s:431:\"For Our Clients: To offer a global touch, maintaining Bangladeshi culture in living and work places, with utmost uncompromising service to our clients and value for money.\n\nFor Our Investors: To ensure a smooth upward-reasonable trend of return on investment.\n\n For Our Employees: To give employees a feeling of satisfaction by \n maximizing their potentials and providing means for their personal well-being and career development.\";}i:1;a:2:{s:9:\"faq_title\";s:26:\"What should we choose you?\";s:15:\"faq_description\";s:0:\"\";}i:2;a:2:{s:9:\"faq_title\";s:32:\"What type of projects do you do?\";s:15:\"faq_description\";s:85:\"We do new Apartment , used Apartment, Commercial , Interior design and Construction. \";}i:3;a:2:{s:9:\"faq_title\";s:29:\"How do you manage the budget?\";s:15:\"faq_description\";s:0:\"\";}i:4;a:2:{s:9:\"faq_title\";s:38:\"What is monthly common service charge?\";s:15:\"faq_description\";s:282:\"The monthly common service charge is collected monthly by the Committee from all the apartment owners and is used towards the running costs of your apartment complex. It typically covers the cost of utility bills, generator fuel and lift maintenance, security guards salary, etc.\";}}s:13:\"faq_seo_title\";N;s:17:\"faq_meta_keywords\";N;s:20:\"faq_meta_description\";N;}', 1, 1, 1, 2, NULL, '2021-06-01 04:15:49'),
